import React from "react";
import { NavLink } from "react-router-dom";

import "./styles.scss";



const NewsItem = ({ item }) => (
  <NavLink className="newsItem" to={routePostItem(item.id)}>
    <div className="title">
      <p>Title</p>
      {item.title}
    </div>
    <div className="bottonwrapper">
      <div className="body">
        <p>Body</p>
        {item.body}
      </div>
    </div>
  </NavLink>
);
export default NewsItem;
